import { Component } from '@angular/core';

@Component({
  selector: 'app-todos',
  templateUrl: './todos.component.html',
  styleUrls: ['./todos.component.css']
})
export class TodosComponent {
todo = "yo"
}
<div class="todos">
    <div class="todo">{{todo}}
        <div class="id">0</div>
        <div class="content">My Todo</div>
        <button class="delete">Remove</button>
    </div>
</div>
